import './index.scss';
import { useEffect, useRef } from 'react';
import DrawSVGPlugin from 'gsap-trial/DrawSVGPlugin';
import gsap from 'gsap-trial';

const Logo = () => {

    const bgRef = useRef()
    const outlineLogoRef = useRef()
    const didAnimate = useRef(false)

    useEffect(() => {

        didAnimate.current = true
        gsap.registerPlugin(DrawSVGPlugin)

        gsap.timeline()
            .to(bgRef.current, {
                duration: 1,
                opacity: 1,
            })
            .from(outlineLogoRef.current, {
                drawSVG: 0,
                duration: 20,
            })

    }, [])

    return (
        <div className="logo-container" ref={bgRef}>
            <svg 
                xmlns="http://www.w3.org/2000/svg" 
                viewBox="0 0 500 900" 
                overflow="hidden" 
                preserveAspectRatio="xMidYMid meet" 
                id="eaf-754:0" 
                width="500" 
                height="900">
                <g>
                    <line x1="0" y1="0" x2="0" y2="800" transform="translate(40 10.949646)" fill="rgb(186 186 186)" stroke="rgb(36 123 160)" stroke-width="5" stroke-linecap="round" stroke-dasharray="0" class="svg-elem-2"></line>
                    <line x1="0" y1="0" x2="-80" y2="0" transform="translate(410 10.949646)" fill="rgb(186 186 186)" stroke="rgb(36 123 160)" stroke-width="5" stroke-linecap="round" stroke-dasharray="0" class="svg-elem-3"></line>
