                    <line x1="0" y1="0" x2="-210" y2="-580.474823" transform="matrix(-1 0 0 -1 180 270.47479248046875)" fill="rgb(186 186 186)" stroke="rgb(36 123 160)" stroke-width="5" stroke-linecap="round" stroke-dasharray="0" class="svg-elem-5"></line>
                    <line x1="0" y1="0" x2="80" y2="0" transform="translate(100 850.949646)" fill="rgb(186 186 186)" stroke="rgb(36 123 160)" stroke-width="5" stroke-linecap="round" stroke-dasharray="0" class="svg-elem-6"></line>
                    <line x1="0" y1="0" x2="80" y2="0" transform="translate(390 850.949646)" fill="rgb(186 186 186)" stroke="rgb(36 123 160)" stroke-width="5" stroke-linecap="round" stroke-dasharray="0" class="svg-elem-7"></line>
                    <line x1="0" y1="0" x2="-80" y2="0" transform="matrix(-1 0 0 1 390.25409842396743 50.94964599609375)" fill="rgb(186 186 186)" stroke="rgb(36 123 160)" stroke-width="5" stroke-linecap="round" stroke-dasharray="0" class="svg-elem-8"></line>
                    <line x1="0" y1="0" x2="0" y2="580.474823" transform="matrix(1 0 0 -1 179.99999999999994 850.9496459960938)" fill="rgb(186 186 186)" stroke="rgb(36 123 160)" stroke-width="5" stroke-linecap="round" stroke-dasharray="0" class="svg-elem-9"></line>
                    <line x1="0" y1="0" x2="-0" y2="579.050354" transform="matrix(1 0 0 -1 390 630)" fill="rgb(186 186 186)" stroke="rgb(36 123 160)" stroke-width="5" stroke-linecap="round" stroke-dasharray="0" class="svg-elem-10"></line>
                    <line x1="0" y1="0" x2="60" y2="40" transform="matrix(-1 0 0 -1 390.00000000000006 50.94964599609375)" fill="rgb(186 186 186)" stroke="rgb(36 123 160)" stroke-width="5" stroke-linecap="round" stroke-dasharray="0" class="svg-elem-11"></line>
                    <line x1="0" y1="0" x2="60" y2="40" transform="translate(410 10.949646)" fill="rgb(186 186 186)" stroke="rgb(36 123 160)" stroke-width="5" stroke-linecap="round" stroke-dasharray="0" class="svg-elem-12"></line>
                    <line x1="0" y1="0" x2="60" y2="40" transform="translate(40 810.94967651)" fill="rgb(186 186 186)" stroke="rgb(36 123 160)" stroke-width="5" stroke-linecap="round" stroke-dasharray="0" class="svg-elem-13"></line>
