                    <line x1="0" y1="0" x2="0" y2="800" transform="translate(100 50.949646)" fill="rgb(186 186 186)" stroke="rgb(36 123 160)" stroke-width="5" stroke-linecap="round" stroke-dasharray="0" class="svg-elem-16"></line>
