                    <line x1="0" y1="0" x2="80" y2="0" transform="translate(100 50.949646)" fill="rgb(186 186 186)" stroke="rgb(36 123 160)" stroke-width="5" stroke-linecap="round" stroke-dasharray="0" class="svg-elem-19"></line>
                    <line x1="0" y1="0" x2="60" y2="40" transform="translate(120 10.949646)" fill="rgb(186 186 186)" stroke="rgb(36 123 160)" stroke-width="5" stroke-linecap="round" stroke-dasharray="0" class="svg-elem-20"></line>
                    <line x1="0" y1="0" x2="60" y2="40" transform="translate(40 10.949646)" fill="rgb(186 186 186)" stroke="rgb(36 123 160)" stroke-width="5" stroke-linecap="round" stroke-dasharray="0" class="svg-elem-21"></line>
                    <line x1="0" y1="0" x2="80" y2="0" transform="translate(40 10.949646)" fill="rgb(186 186 186)" stroke="rgb(36 123 160)" stroke-width="5" stroke-linecap="round" stroke-dasharray="0" class="svg-elem-22"></line>
                </g>
            </svg>
        </div>
    )
}

export default Logo;
